function Notify(titletxt, time)
    local GUI = Instance.new("ScreenGui")
    local Main = Instance.new("Frame", GUI)
    local title = Instance.new("TextLabel", Main)

    GUI.Name = "NotificationOof"
    GUI.Parent = game.CoreGui
    Main.Name = "MainFrame"
    Main.BackgroundColor3 = Color3.new(0.156863, 0.156863, 0.156863)
    Main.BackgroundTransparency = 1
    Main.BorderSizePixel = 0
    Main.Position = UDim2.new(0.5,0,0.5,-490) -- จุดที่สร้าง
    Main.AnchorPoint = Vector2.new(0.5, 0.5)
    Main.Size = UDim2.new(0, 330, 0, 100)

    title.BackgroundColor3 = Color3.new(0, 0, 0)
    title.Font = "Arcade"
    title.FontSize = "Size36"
    title.TextWrapped = true
    title.Text = titletxt
    title.Size = UDim2.new(1,0,1,0)
    title.BackgroundTransparency = 1
    title.TextStrokeTransparency = 0
    title.TextColor3 = Color3.fromRGB(255,255,255)


    wait(0.1)
    Main:TweenPosition(UDim2.new(0.5,0,0.5,-120), "Out", "Sine", 0.5)
    wait(time)
    Main:TweenPosition(UDim2.new(0.5,0,0.5,-490), "Out", "Sine", 0.5)
    wait(0.6)
    GUI:Destroy();
end

